import React from "react";
import { styled } from "@mui/material/styles";

const StyledContainer = styled("div")(({ theme }) => ({
  paddingTop: theme.spacing(2),
}));

function Rightbar() {
  return (
    <div>
      <StyledContainer>Rightbar</StyledContainer>
    </div>
  );
}

export default Rightbar;
